graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>foo</b></font></td></tr><tr><td align="center"><font point-size="10">v @style</font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  rankdir="LR";
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_a {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>a</b> <i>&lt;init&gt;</i></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "a__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_b {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>b</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "b__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "c" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>c</b> <i>@x</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="prop__key" align="left" balign="left">prop</td><td port="prop__value" align="left" balign="left">val</td></tr></table></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C", xrank="min", color="yellow"];
      subgraph cluster_d {
        label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>d</b></td></tr></table>>;
        labelloc="t";
        style=filled;
        fontsize=10;
        fillcolor="#FFFFFF";
        color="#999999";
        color="blue";
        "d" [label=<<table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="link__key" align="left" balign="left">link</td><td port="link__value" align="left" balign="left">f</td></tr></table>>, shape=plain, margin=0];
        "d__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

        subgraph cluster_e {
          label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>e</b></td></tr></table>>;
          labelloc="t";
          style=filled;
          fontsize=10;
          fillcolor="#FFFFFF";
          color="#999999";
          "e__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

          "f" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>f</b> <i>@x</i></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000", xrank="min", color="yellow"];
        }
      }
    }
  }
  subgraph cluster_one {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>one</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    color="green";
    "one__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_two {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>two</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      shape="circle";
      "two__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "three" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>three</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
    }
  }

  // Edges
  "b__cluster_anchor" -> "two__cluster_anchor" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">@style(color: red; penwidth: 3;)</td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD", ltail="cluster_b", lhead="cluster_two", color="red", penwidth="3"];
  "d":"link__value" -> "f" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left">link</td></tr></table>>, labelOverlay="75%", labelhref="#srcLineTBD"];
}
